  [],\n\t\"revision_timestamp\": \"2016-08-20T09:39:32.477143\",\n\t\"name\": \"turnbull-early-detection-and-rapid-response-team-bd150\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Funding from this grant will allow for
  the purchase of biocontrol agents and chemicals to facilitate the rapid response
  phase of the project and to provide match for a Washington Service Corps AmeriCorps
  members. With proceeds from this grant , two additional Trimble GEOXM GPS units
  were purchased as were two copies of ArcPad in order to expand the refugeu2019s
  Early Detection Rapid Response Program (EDRPP). Weed surveys were conducted by AmeriCorp
  and SCA volunteers in the North Camas Canyon, Howellia_A, and Stubblefield Units
  in August. As part of the EDRPP refuge volunteers continue a systematic survey of
  the refuge using a 50 meter point grid. Volunteers navigate to each point and collect
  information on the presence and abundance of 25 weed species within a 0.10 acre
  plot. Additional points and area features are mapped when any of ten, class A weed
  species are encounteredbetween points. Approximately 1200 points were sampled on
  the 50 meter point grid representing around 685 acres. The survey work resulted
  in the location of yellow starthistle in the Stubblefield Unit which is the first
  time it has been seen on the refuge. The entire infested area was mapped and it
  was sprayed this fall with a preemergent herbicide. A portion of this grant was
  used to purchase additional chemicals for treating new infestations located and
  past areas mapped to maintain control. Nearly 200acres of the refuge were treated
  this year with herbicides, mowing and hand pulling to control invasive species.\",\n\t\"license_title\":
